class Solution:
    def takeCharacters(self, s: str, k: int) -> int:
        def can_jump(a, b):
            if a < 0:
                return all([y >= k for y in pfx_right[b]])
            else:
                return all([x + y >= k for x, y in zip(pfx_left[a], pfx_right[b])])
        if k == 0:
            return 0
        if s.count('a') < k or s.count('b') < k or s.count('c') < k:
            return -1
        N = len(s)
        pfx_left = [[0,0,0] for _ in range(N)]
        for i in range(N):
            arr = [int(s[i] == ch) for ch in 'abc']
            if i == 0:
                pfx_left[i] = arr
            else:
                pfx_left[i] = [x+y for x, y in zip(pfx_left[i-1], arr)]
        pfx_right = [[0,0,0] for _ in range(N)]
        for i in range(N-1, -1, -1):
            arr = [int(s[i] == ch) for ch in 'abc']
            if i == N - 1:
                pfx_right[i] = arr
            else:
                pfx_right[i] = [x+y for x, y in zip(pfx_right[i+1], arr)]
        #print(pfx_left)
        #print(pfx_right)
        i, j = -1, -1
        res = float('inf')
        while i < N:
            if i >= 0 and all([x >= k for x in pfx_left[i]]):
                res = min(res, i+1)
            else:
                #j = i
                while j+1 < N and can_jump(i, j+1):
                    j += 1
                if i == N - 1:
                    j = 0
                #print(i, j, N - j + i + 1)
                res = min(res, N - j + i + 1)
            i += 1
        return res

# Main section
for s, k in [
               ('aabaaaacaabc', 2),
               ('a', 1),
               ('aaaaabcaaa', 1),
               ('aabcabacaaaccbaaaabcbcbcaccbcabccbcccabccbbbcbabcbbaaccaabcabcacbcacbcaccacaccabbcccbbacbcccbbcbbaab', 3),
               ('', 7),
               ('', 399),
               ('a', 0),
               ('aabbccca', 2),
               #('', 32701),
            ]:
    print(f's, k = {s}, {k}')
    sol = Solution()
    r = sol.takeCharacters(s, k)
    print(f'r = {r}')
    print('======================')


